import os
from os.path import join


def minWindow(s, t):
    count = [[] for c in t]
    
    count_flat = []
    tt = [c for c in t]
    window_len = float('Inf')
    min_window = []
    flat = [0]
    success = False
    for i, c in enumerate(s):
        if c in t:
            c_idx = t.index(c)
            if len(tt) > 0 and c in tt:
                tt.remove(c)
                count[c_idx].append(i)
                count_flat.append(i)
            elif c not in tt:
                tmp = count[c_idx][0]
                count[c_idx].pop(0)
                count[c_idx].append(i)
                count_flat.remove(tmp)
                count_flat.append(i)
            if len(tt) == 0:
                success = True
                tmp1 = count_flat
                tmp2 = max(tmp1) - min(tmp1) + 1
                if window_len > tmp2:
                    window_len = tmp2
                    flat = tmp1
        print(i, c, count, flat, s[min(flat):max(flat) + 1], window_len)

    return s[min(flat):max(flat) + 1] if success else ''


